import csvimport matplotlib.pyplot as pltfrom MachineLearningConcepts import LinearRegressionwith open("MPI_national.csv", "r") as csv_doc:    reader = csv.reader(csv_doc, delimiter = ",", quotechar = '"')    # dataread = [row for row in reader]    rural = []    urban = []    first_run=True    for row in reader:        if first_run:            first_run=False        else:            urban.append(float(row[4]))            rural.append(float(row[7]))rural_vs_urban_data = LinearRegression.Data(features=rural, results=urban)rural_vs_urban_data.print_info()rural_vs_urban_data.batch_gradient_descent()rural_vs_urban_data.print_info()rural_vs_urban_data.cost()# plt.plot(urban, rural, "ro")# plt.show()